name = "zhivaya-bot"
version = "0.1.0"
source = { virtual = "." }
dependencies = [
    { name = "aiogram" },
    { name = "asyncpg" },
    { name = "databases" },
    { name = "fastapi" },
    { name = "httpx" },
    { name = "nc-py-api" },
    { name = "openai" },
    { name = "pydantic" },
    { name = "pydantic-settings" },
    { name = "pyjwt" },
    { name = "pytz" },
    { name = "redis" },
    { name = "structlog" },
    { name = "ujson" },
    { name = "uvicorn" },
]

[package.dev-dependencies]
dev = [
    { name = "ngrok" },
    { name = "ruff" },
]

[package.metadata]
requires-dist = [
    { name = "aiogram", specifier = ">=3.17.0" },
    { name = "asyncpg", specifier = ">=0.30.0" },
    { name = "databases", specifier = ">=0.9.0" },
    { name = "fastapi", specifier = ">=0.115.7" },
    { name = "httpx", specifier = ">=0.28.1" },
    { name = "nc-py-api", specifier = ">=0.19.0" },
    { name = "openai", specifier = ">=1.60.1" },
    { name = "pydantic", specifier = ">=2.10.6" },
    { name = "pydantic-settings", specifier = ">=2.7.1" },
    { name = "pyjwt", specifier = ">=2.10.1" },
    { name = "pytz", specifier = ">=2024.2" },
    { name = "redis", specifier = ">=5.2.1" },
    { name = "structlog", specifier = ">=25.1.0" },
    { name = "ujson", specifier = ">=5.10.0" },
    { name = "uvicorn", specifier = ">=0.34.0" },
]

[package.metadata.requires-dev]
dev = [
    { name = "ngrok", specifier = ">=1.4.0" },
    { name = "ruff", specifier = ">=0.9.3" },
]
